<script>
export default {
    name: "Preloader",
    data() {
        return {
            percent: 0,
            duration: 2800,
            loading: false,
        }
    },
    mounted() {
        this.loading = setInterval(() => {
            if (this.percent >= 100) {
                this.finish();
                clearInterval(this.loading)
                return;
            }
            this.increase(1);
        }, this.duration / 100)

    },
    methods: {
        start () {
            this.loading = true
        },
        finish () {
            this.loading = false
            this.$nuxt.$emit('loaded')
        },
        increase (num) {
            this.percent = Math.min(100, Math.floor(this.percent + num))            
        },
    }
}
</script>
